import React, {Component} from 'react'
import { Table } from 'react-bootstrap';


class Main2 extends Component {
    render() {
        return (
        <div id='content' className='mt-3'>
            <table>
                <thead>
                <tr>
                    <th></th>
                    <th></th>
                </tr>
                </thead>
                <tbody>
                    
                </tbody>
            </table>
        </div>   
           
        )
    }
}
export default Main2;
